import React from "react";
import daten from "../daten/HF2Uebungenloesungen.json";
import UebungsKarte from "../components/UebungsKarte";

const HF2Uebungen = () => (
    <div>
        <h2>HF 2 – Übungsaufgaben</h2>
        {daten.map((aufgabe) => (
            <UebungsKarte
                key={aufgabe.nummer}
                nummer={aufgabe.nummer}
                aufgabe={aufgabe.aufgabe}
                antworten={aufgabe.antworten}
                loesung={aufgabe.loesung}
            />
        ))}
    </div>
);

export default HF1Uebungen;
